import { motion } from 'framer-motion';
import AdviceCarousel from '../components/carousel';


const StarterKit = () => {
  const resources = [
    {
      title: 'Getting Started Guide',
      description: 'Essential tips and best practices for new freelancers',
      type: 'PDF Guide',
      icon: 'üìö',
      color: 'from-blue-500 to-blue-600'
    },
    {
      title: 'Portfolio Templates',
      description: 'Professional templates to showcase your work',
      type: 'Templates',
      icon: 'üé®',
      color: 'from-purple-500 to-purple-600'
    },
    {
      title: 'Pricing Calculator',
      description: 'Tool to help you set competitive rates',
      type: 'Tool',
      icon: 'üí∞',
      color: 'from-green-500 to-green-600'
    },
    {
      title: 'Contract Templates',
      description: 'Legal templates for client agreements',
      type: 'Documents',
      icon: 'üìÑ',
      color: 'from-red-500 to-red-600'
    }
  ];

  const additionalResources = [
    {
      title: 'Marketing Guide',
      description: 'Learn how to market your services effectively',
      icon: 'üì¢'
    },
    {
      title: 'Client Communication Templates',
      description: 'Professional email and message templates',
      icon: '‚úâÔ∏è'
    },
    {
      title: 'Tax Guide for Freelancers',
      description: 'Essential tax information and tips',
      icon: 'üìä'
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        type: "spring",
        stiffness: 100
      }
    }
  };

  return (
    <motion.div
      variants={containerVariants}
      initial="hidden"
      animate="visible"
      className="p-4 md:p-8 max-w-7xl mx-auto"
    >
      <motion.div variants={itemVariants} className="text-center mb-12">
        <h1 className="text-3xl md:text-5xl font-bold mb-4 bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent">
          Freelancer Starter Kit
        </h1>
        <p className="text-lg md:text-xl text-gray-600 max-w-3xl mx-auto">
          Essential resources to help you start your freelancing journey
        </p>
      </motion.div>

      <motion.div
        variants={containerVariants}
        className="grid grid-cols-1 md:grid-cols-2 gap-6 md:gap-8"
      >
        {resources.map((resource, index) => (
          <motion.div
            key={index}
            variants={itemVariants}
            whileHover={{ scale: 1.02 }}
            className="bg-white rounded-xl shadow-lg overflow-hidden hover:shadow-xl transition-all duration-300"
          >
            <div className={`p-6 bg-gradient-to-r ${resource.color} text-white`}>
              <div className="flex items-center justify-between">
                <h2 className="text-xl font-semibold">{resource.title}</h2>
                <span className="text-3xl">{resource.icon}</span>
              </div>
            </div>
            <div className="p-6">
              <p className="text-gray-600 mb-4">{resource.description}</p>
              <div className="flex items-center justify-between">
                <span className="bg-gray-100 text-gray-800 px-3 py-1 rounded-full text-sm">
                  {resource.type}
                </span>
                <motion.button
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                  className="bg-gradient-to-r from-blue-600 to-purple-600 text-white px-4 py-2 rounded-lg hover:from-blue-700 hover:to-purple-700 transition-all"
                >
                  Download
                </motion.button>
              </div>
            </div>
          </motion.div>
        ))}
      </motion.div>

      <motion.div
        variants={itemVariants}
        className="mt-12 bg-gradient-to-r from-blue-600 to-purple-600 rounded-xl p-8 text-white"
      >
        <h2 className="text-2xl md:text-3xl font-bold mb-6">Additional Resources</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          {additionalResources.map((resource, index) => (
            <motion.div
              key={index}
              whileHover={{ scale: 1.05 }}
              className="bg-white/10 backdrop-blur-sm rounded-lg p-6"
            >
              <div className="text-3xl mb-4">{resource.icon}</div>
              <h3 className="text-xl font-semibold mb-2">{resource.title}</h3>
              <p className="text-white/80">{resource.description}</p>
            </motion.div>
          ))}
        </div>
      </motion.div>

      <motion.div
        variants={itemVariants}
        className="mt-12 text-center"
      >
        <p className="text-gray-600 mb-4">Need more help getting started?</p>
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          className="bg-gradient-to-r from-blue-600 to-purple-600 text-white px-8 py-3 rounded-lg font-semibold hover:from-blue-700 hover:to-purple-700 transition-all"
        >
          Contact Support
        </motion.button>
      </motion.div>
    </motion.div>
  );
};

export default StarterKit;
